import React from "react";

class MyBouton extends React.Component {
    render(){

        const classBtn = ` btn btn-${this.props.couleur} `

        return(
            <button type={this.props.type} className={classBtn}>{this.props.children}</button>
        )
    }
}

export default MyBouton
